import React from 'react'
import './Navig.style.css'

import {Nav,NavbarToggler,Collapse, Navbar, NavbarBrand, Col, Row, Container} from 'reactstrap'

import{NavigReus} from './NavigationReus'



class Navig extends React.Component {
    constructor(props){
        super(props);
        this.state ={
            isNavOpen: false
        }
    }

    openOrClose = () =>{
        this.setState({
            isNavOpen: !this.state.isNavOpen
        })
    }


    render(){
    return(
        <Navbar light sticky='top' expand='md'>
            <Container>
                <Row  >
                    <Col xs='10'>
                        <NavbarBrand className='mr-auto' href="/home">
                            <img src='https://media.giphy.com/media/JmPabUqU22FAbQYkzN/giphy.gif' alt='robotlogo' width='20%' height='20%' />
                        </NavbarBrand>
                    </Col>

                    <Col xs='2'>

                        <NavbarToggler className='text-right' onClick={this.openOrClose} />

                    </Col>


                </Row>
            </Container>
        </Navbar>               
    )
    }
}

export default Navig
